import { SET_PRODUCTS } from "../types/Types";
export const Increment = () => {
  return {
    type: "INCREMENT",
  };
};

export const Decrement = () => {
  return {
    type: "DECREMENT;",
  };
};

export const Start = () => {
  return {
    type: "START",
  };
};
export const Stop = () => {
  return {
    type: "STOP",
  };
};

export const fetchProducts = () => {
  return async function (dispatch) {
    const res = await fetch("https://asos2.p.rapidapi.com/v2/auto-complete", {
      method: "GET",
      headers: {
        "x-rapidapi-host": "asos2.p.rapidapi.com",
        "x-rapidapi-key": "43c82d288dmsh345a8467ecae14dp1cd9c2jsnef27a5ea830c",
      },
    });
    const data = await res.json();

    dispatch(setProducts(data.products));
  };
};

export const setProducts = (products = null) => {
  if (products) {
    return {
      type: SET_PRODUCTS,
      payload: products,
    };
  }

  return {
    type: SET_PRODUCTS,
    payload: [],
  };
};
